import './Card.css'

function Card(props)
{
    return(
        <div>
        <h2>{props.name}</h2>
        <img src="https://mdz.cs.pollub.pl/ai/dennis_ritchie.jpg" alt = "Dennis Ritchie" />
        <p>{props.date}</p>
        <p>{props.educatio}n</p>
        <p>{props.country}</p>
        </div>
    )
}

export default Card
